  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer called the Sea Level Rise and Coastal
  Flooding Impacts Viewer. It depicts potential sea level rise and its associated
  impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
  coastal managers and scientists with a preliminary look at sea level rise and coastal
  flooding impacts. The viewer is a screening-level tool that uses nationally consistent
  data sets and analyses. Data and maps provided can be used at several scales to
  help gauge trends and prioritize actions for different scenarios. The Sea Level
  Rise and Coastal Flooding Impacts Viewer may be accessed at: https://coast.noaa.gov/slr.
  This metadata record describes the North Carolina, Southern 1 digital elevation
  model (DEM), which is a part of a series of DEMs produced for the National Oceanic
  and Atmospheric Administration Office for Coastal Management's Sea Level Rise and
  Coastal Flooding Impacts Viewer described above. This DEM includes the best available
  lidar known to exist at the time of DEM creation that met project specifications.
  This DEM includes data for Bladen, Brunswick, Columbus, New Hanover, and Pender
  Counties. The DEM was produced from the following lidar data sets: 1. 2014 NGS Coastal
  Mapping Program Topobathy Lidar: Post-Sandy Atlantic Seaboard 2. 2014 NC Statewide
  Lidar - Phase 2 The DEM is referenced vertically to the North American Vertical
  Datum of 1988 (NAVD88) with vertical units of meters and horizontally to the North
  American Datum of 1983 (NAD83). The resolution of the DEM is approximately 3 meters.\",\n\t\"owner_org\":
